async def send_request(url):
    async with aiohttp.ClientSession('http://192.168.1.100:10101') as session:
        return await session.get(url=url)


async def send_pool(pool):
    tasks = [asyncio.create_task(send_request(image)) for image in pool]
    return await asyncio.wait(tasks)


